DROP TABLE IF EXISTS `products_list`;

CREATE TABLE `products_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `brand_name` varchar(45) DEFAULT NULL,
  `product_name` varchar(255) DEFAULT NULL,
  `sku` varchar(255) DEFAULT NULL,
  `description` text,
  `material_composition` text,
  `gender` varchar(100) DEFAULT NULL,
  `color_detail` varchar(100) DEFAULT NULL,
  `size_detail` varchar(100) DEFAULT NULL,
  `length_detail` varchar(100) DEFAULT NULL,
  `pattern_detail` varchar(100) DEFAULT NULL,
  `available_sizes` varchar(1000) DEFAULT NULL,
  `filename` varchar(255) DEFAULT NULL,
  `base_price` decimal(10,3) NOT NULL,
  `actual_price` decimal(10,3) NOT NULL,
  `sale_active` tinyint(4) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


